'',
'/*',
' * handle click for the "New" button. ',
' */ ',
'$(''.poca-lov-new'').on(''click'', function() {',
'  var $opener = $(this);',
'  var $display = $opener.parent().prev().find(''input'');',
'  var funcBody = $display.data(''lovSearchJs'').replace(/^"javascript:/, '''').replace(/\"$/,'''');',
'  new Function(funcBody).call($display.get(0));',
'});',
'',
'',
'',
'/*',
' * Iterate over all POCA Popup List of Values. These are identified by the "poca-lov" class attribute',
' */',
'$(''.poca-lov'').each(function(index) {',
'  var $this = $(this);',
'    ',
'  // if the popup lov item is read only, then hide the new button',
'  if ($(this).attr(''class'').indexOf(''display-only'') > -1) {',
'    $(this).parent().find(''.poca-lov-new'').hide();',
'  }',
'    ',
'  // if the poca popup lov item is empty, then hide the edit button, otherwise show it.',
'  if($v($(this).attr(''id'')) != "") {',
