,p_theme_id=>101
,p_name=>'Right Side Column'
,p_internal_name=>'RIGHT_SIDE_COLUMN'
,p_is_popup=>false
,p_javascript_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'function replace_broken_img_tags(img)',
'{',
'  img.onerror = "";',
'  mime_type = img.alt;',
'  switch (mime_type) {',
'    case ''application/msword'':',
'    case ''application/vnd.openxmlformats-officedocument.wordprocessingml.document'':   ',
'      img.src="#WORKSPACE_IMAGES#Word-icon.png";',
'      break;',
'    case ''video/x-ms-wmv'':',
'      img.src="#WORKSPACE_IMAGES#video_x_ms_wmv.png";',
'      break;',
'    case ''video/mpeg'':',
'      img.src="#WORKSPACE_IMAGES#mpg4.png";',
'      break;',
'    case ''video/x-m4v'':',
'    case ''video/mp4'':',
'      img.src="#WORKSPACE_IMAGES#mpg4.png";',
'      break;',
'    case ''application/pdf'':',
'      img.src="#WORKSPACE_IMAGES#filetype_pdf.png";',
'      break;',
'    case ''text/plain'':',
'      img.src="#WORKSPACE_IMAGES#notepad.png";',
'      break;',
'    case ''application/zip'':',
'    case ''application/x-zip-compressed'':',
'      img.src="#WORKSPACE_IMAGES#media_zip.png";',
'      break;',
'    case ''application/vnd.openxmlformats-officedocument.spreadsheetml.sheet'':',
'      img.src="#WORKSPACE_IMAGES#excel.png";',
'      break;',
'    case ''application/vnd.openxmlformats-officedocument.presentationml.presentation'':',
'      img.src="#WORKSPACE_IMAGES#powerpoint.png";',
'      break;',
'    case ''text/xml'':',
'      img.src="#WORKSPACE_IMAGES#xml.png";',
'      break;',
'    case ''video/quicktime'':',
'      img.src="#WORKSPACE_IMAGES#quicktime.png";',
'      break;',
'    case ''video/x-flv'':',
'      img.src="#WORKSPACE_IMAGES#flv.png";',
'      break;',
'    case ''text/html'':',
'      img.src="#WORKSPACE_IMAGES#html.png";',
'      break;',
'    case ''application/msaccess'':',
'    case ''application/x-msaccess'':',
'      img.src="#WORKSPACE_IMAGES#access.png";',
'      break;',
'   case ''application/vnd.google-earth.kmz'':',
'   case ''application/vnd.google-earth.kml+xml'':',
'      img.src="#WORKSPACE_IMAGES#kmz.png";',
'      break;',
'   case ''application/octet-stream'':',
'      img.src="#WORKSPACE_IMAGES#binary.png";',
'      break;',
'    default:',
'      img.src="#WORKSPACE_IMAGES#Document.png";',
'      break;',
