'      var cVal = _cVal ? _cVal[1] : null;',
'//alert(''cVal:'' + cVal);',
'      var _searchlist = /piglovsearch=([^;]*);/.exec(document.cookie);',
'      var searchlist = _searchlist ? _searchlist[1] : null;',
'//alert(''searchlist:'' + searchlist);',
'      var columnId = ''C_ENGINEER''    //  = /opener\.\$x\([''"]([^\"'']+)[''"]\)/.exec($(''script'').text())[1];      ',
