'        $(document).on(''apexafterclosedialog'', function(closeEvt, data) {',
'          var dkey = /f\?p=([^\:]*)\:([^\:]*)\:([^\:]*)\:([^\:]*)\:([^\:]*)\:([^\:]*)\:([^\:]*)\:([^\:]*)/.exec(piglovEditJs)[7];',
'          //alert(dkey + " " + data[dkey]);  ',
