,p_inline_css=>wwv_flow_string.join(wwv_flow_t_varchar2(
'/*Section Containing Tabs and Navigation Bar*/',
'div.uParentTabs {',
'  position: static;',
'  float: left;',
'}',
'header#uHeader hgroup a#uLogo {',
'  /*float: left;*/',
'  margin: 2px 4px;',
'}',
