'  margin-bottom: 8px;',
'  margin-left: 5px;',
'  z-index: 0;',
'}',
'',
'header#uHeader {',
'  background: #4070AC;',
'}',
'',
'div.uParentTabs ul li a {',
'  font-size: 12px;',
'  background: rgb(175,190,235);',
'  padding: 2px 6px;',
'  font-weight: bold;',
'  color:black;',
'}',
'',
'div.userBlock {',
'  position: static;',
'  float:right;',
'  margin-top: 5px;',
'  margin-bottom: 0px;',
'  margin-right: 5px;',
'  margin-left: 5px;',
'  background: silver;',
'}',
'',
'div.userBlock a {',
'  background: mintcream;',
'  border-color: royalblue;',
'}',
'',
'div.userBlock a:hover {',
'    background-color: lightgray;',
'}',
'',
'nav.uChildTabs {',
'  clear: both;',
'}',
'header#uHeader nav > ul {',
'  overflow: visible;',
'  margin-right: 0;',
'}',
'header#uHeader nav > ul li a {',
'  font-size: 12px;',
'}',
'',
'/*IE Table Layout*/',
'.ie7 table#uPageCols{',
'	table-layout:auto;',
'}',
'',
'/*Large Button List Region*/',
'section.uButtonRegion {',
'  margin: 0 10px 8px;',
'}',
'section.uButtonRegion div.uButtonRegionContentContainer {',
'  background-color: #FFF;',
'}',
'section.uButtonRegion div.uButtonRegionContentContainer div.uButtonRegionContent {',
'  width: 98%;',
'}',
'',
'/*List With Images and Captions*/',
'div.uImagesList ul {',
'  min-width: 600px;',
'  margin: 0 auto;',
'}',
'div.uImagesList ul li {',
'  border-radius: 15px;',
'  background-color: #FFF;',
'  border: 1px solid transparent;  ',
'  transition: background-color 0.3s ease-in 0.1s,',
'              border 0.2s ease-in 0.1s;',
'}',
'/*Width based on number of items in list*/',
'/* one item */',
'div.uImagesList ul li:first-child:nth-last-child(1) {',
'	width: 98%;',
'}',
'/* two items */',
'div.uImagesList ul li:first-child:nth-last-child(2),',
'div.uImagesList ul li:first-child:nth-last-child(2) ~ li {',
'	width: 48%;',
'}',
'/* three items */',
'div.uImagesList ul li:first-child:nth-last-child(3),',
'div.uImagesList ul li:first-child:nth-last-child(3) ~ li {',
'	width: 32%;',
'}',
'/* four items */',
'div.uImagesList ul li:first-child:nth-last-child(4),',
'div.uImagesList ul li:first-child:nth-last-child(4) ~ li {',
'	width: 24%;',
'}',
'/* five items */',
'div.uImagesList ul li:first-child:nth-last-child(5),',
'div.uImagesList ul li:first-child:nth-last-child(5) ~ li {',
'	width: 19%;',
'}',
'/* six items */',
'div.uImagesList ul li:first-child:nth-last-child(6),',
'div.uImagesList ul li:first-child:nth-last-child(6) ~ li {',
'	width: 15%;',
'}',
'',
'/* seven items */',
'div.uImagesList ul li:first-child:nth-last-child(7),',
'div.uImagesList ul li:first-child:nth-last-child(7) ~ li {',
'	width: 13.5%;',
'}',
'/* eight items */',
'div.uImagesList ul li:first-child:nth-last-child(8),',
'div.uImagesList ul li:first-child:nth-last-child(8) ~ li {',
'	width: 12%;',
'}',
'',
'',
'div.uImagesList ul li.active {',
'  background-color: #F6F6F6;',
