begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(51898660227547616)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'MIL.ARMY.USACE.MAPBITS.LAYER.WMS'
,p_display_name=>'Mapbits Layer WMS'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS:APEX_APPL_PAGE_IG_COLUMNS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','MIL.ARMY.USACE.MAPBITS.LAYER.WMS'),'')
,p_javascript_file_urls=>'#PLUGIN_FILES#mapbits-wmslayer.js'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'procedure mapbits_wmslayer (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_render_param,',
'    p_result in out nocopy apex_plugin.t_item_render_result ) is',
'    l_region_id varchar2(4000); --apex_application_page_regions.region_id%type;',
'    l_url varchar2(4000) := p_item.attribute_01;',
'    l_layers varchar2(4000) := p_item.attribute_02;',
'    l_title varchar2(4000) := p_item.attribute_03;',
'    l_checkbox_color p_item.attribute_04%type := p_item.attribute_04;',
'    l_sequence_no apex_application_page_items.display_sequence%type;',
'    l_initVisibility p_item.attribute_05%type := p_item.attribute_05;',
'    l_error varchar2(4000) := ''''; ',
'begin',
'  begin',
'    select nvl(r.static_id, ''R'' || r.region_id), i.display_sequence into l_region_id, l_sequence_no  ',
'      from apex_application_page_items i ',
'      inner join apex_application_page_regions r on i.region_id = r.region_id ',
'      where i.item_id = p_item.id and r.source_type = ''Map'';',
'  exception',
'    when NO_DATA_FOUND then ',
'      apex_debug.message(',
'        p_message => ''ERROR: Map Layer WMS Item [%s] is not associated with a Map region.'',',
'        p0      => p_item.id,',
'        p_level   => apex_debug.c_log_level_error',
'      );',
'      l_error := l_error || ''ERROR: Map Layer WMS Item ['' ||p_item.id || ''] is not associated with a Map region.'';',
'  end;',
'  htp.p(''<div id="'' || p_item.name || ''" name="'' || p_item.name || ''"></div>'');',
'  apex_javascript.add_onload_code(p_code => ''apex.jQuery(apex.gPageContext$).on("apexreadyend", function(){',
'    mapbits_wmslayer("'' || p_item.name || ''", "'' || apex_plugin.get_ajax_identifier || ''", "'' || l_region_id || ''", "'' || l_title || ''", "'' || l_url || ''", "'' || l_layers || ''", '' || l_sequence_no || '', "'' || l_checkbox_color || ''", "'' || l_initVisib'
||'ility || ''", "'' || l_error || ''");',
'    });'', p_key => ''MIL.ARMY.USACE.MAPBITS.LAYER.WMS'' || p_item.name);',
'end;'))
,p_api_version=>2
,p_render_function=>'mapbits_wmslayer'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'The Mapbits Layer WMS plugin adds support for OGC Web Map Service (WMS) raster layers to APEX Map regions. The layer shall appear in the map as defined by the plugin attributes and shall be togglable using the APEX Map built-in layer selector.',
'Add the plugin as an item under an APEX Map region and set the WMS URL to point to your layer''s web service and set the WMS Layer Names to the name of the layers in the service. The WMS url should include everything up to but excluding the quesiton m'
||'ark (?). For example, https://img.nj.gov/imagerywms/Natural2015. The WMS Layers Names are usually number for the ArcGIS implementation. Multiple layers can be combined using a comma (0,1).'))
,p_version_identifier=>'4.2.20220207'
,p_plugin_comment=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Module   : Mapbits 4 Layer - WMS',
'Location : $Id$',
'Date     : $Date$',
'Revision : $Revision$',
'Requires : Application Express >= 21.1',
'',
'Version 4.2 Updates: ',
'(2/07/2022) - Showing a spinner while data is loading.',
'Version 4.1 Updates:',
'(1/13/2022) - Added error handling. Display popup message if WMS is inaccessible.'))
,p_files_version=>4
);
