begin
wwv_flow_api.create_plugin(
 p_id=>wwv_flow_api.id(119000807273263839)
,p_plugin_type=>'ITEM TYPE'
,p_name=>'MIL.ARMY.USACE.MAPBITS.DRAW'
,p_display_name=>'Mapbits Drawing Controls'
,p_supported_ui_types=>'DESKTOP'
,p_supported_component_types=>'APEX_APPLICATION_PAGE_ITEMS:APEX_APPL_PAGE_IG_COLUMNS'
,p_image_prefix => nvl(wwv_flow_application_install.get_static_plugin_file_prefix('ITEM TYPE','MIL.ARMY.USACE.MAPBITS.DRAW'),'')
,p_javascript_file_urls=>wwv_flow_string.join(wwv_flow_t_varchar2(
'#PLUGIN_FILES#mapbox-gl-draw.js',
'#PLUGIN_FILES#lonlat.js',
'#PLUGIN_FILES#mapbits-draw.js'))
,p_css_file_urls=>'#PLUGIN_FILES#mapbox-gl-draw.css'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'procedure map_drawing_controls_render_ajax (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_ajax_param,',
'    p_result in out nocopy apex_plugin.t_item_ajax_result ) is',
'    l_geom_collection_name p_item.attribute_02%type;',
'    l_geomtxt clob;',
'    l_buffer_clob clob;',
'    l_chunk_no number;',
'begin',
'  if apex_application.g_x10 = ''WRITEBACK'' then',
'   l_geom_collection_name := p_item.attribute_02;',
'   if not l_geom_collection_name is null then',
'     l_geomtxt := apex_application.g_x02;',
'     l_chunk_no := apex_application.g_x03;',
'',
'     if l_chunk_no is null or l_chunk_no = 0 then',
'       apex_collection.create_or_truncate_collection(p_collection_name => l_geom_collection_name);',
'       apex_collection.add_member(p_collection_name => l_geom_collection_name,  p_clob001 => l_geomtxt);',
'     else',
'       dbms_lob.createtemporary(l_buffer_clob, TRUE);',
'       select clob001 into l_buffer_clob from apex_collections where collection_name = l_geom_collection_name and seq_id = 1;',
'       l_buffer_clob := l_buffer_clob || l_geomtxt;',
'       apex_collection.update_member(p_collection_name => l_geom_collection_name, p_seq =>1, p_clob001 => l_buffer_clob );',
'       dbms_lob.freetemporary(l_buffer_clob);',
'     end if;',
'     htp.p(''{"Status" : "No Error"}'');',
'   else',
'     htp.p(''{"Status" : "[XYZZY] No Geometry Collection Name specified. Nothing happens."}'');',
'   end if;',
' end if; ',
'end;',
'',
'procedure map_drawing_controls_render (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_render_param,',
'    p_result in out nocopy apex_plugin.t_item_render_result ) is',
'    l_region_id varchar2(400);',
'    l_geometry_modes p_item.attribute_01%type := p_item.attribute_01;',
'    l_geom_collection_name p_item.attribute_02%type := p_item.attribute_02;',
'    l_readonly varchar2(5);',
'    l_geojson clob;',
'    l_error varchar2(4000) := '''';',
'    l_show_coords p_item.attribute_04%type := p_item.attribute_04;',
'    l_buffersize number:=80;',
'    l_offset integer;',
'    l_pointZoomLevel p_item.attribute_06%type := nvl(p_item.attribute_06, 12);',
'begin',
'  -- Read-only attribute',
'  if not p_item.attribute_05 is null then',
'    if V(p_item.attribute_05)  = ''Y'' then',
'      l_readonly := ''true'';',
'    else',
'      l_readonly := ''false'';',
'    end if;',
'  else',
'    l_readonly := ''false'';',
'  end if;',
'  if l_readonly = ''true'' then',
'    l_geometry_modes := '''';',
'  end if;',
'',
'  -- Collection name attribute',
'  begin',
'    select clob001  into l_geojson from apex_collections where collection_name = l_geom_collection_name;',
'  exception when NO_DATA_FOUND then',
'      l_geojson := ''null'';',
'  end;',
'  if l_geojson is null then',
'    l_geojson := ''null'';',
'  end if;',
'',
'  -- Get the map region id for which this item is associated. If this failed, propagate an error.',
'  begin',
'    select nvl(r.static_id, ''R'' || r.region_id) into l_region_id  ',
'      from apex_application_page_items i ',
'      inner join apex_application_page_regions r on i.region_id = r.region_id ',
'      where i.item_id = p_item.id and r.source_type = ''Map'';',
'  exception',
'    when NO_DATA_FOUND then ',
'      apex_debug.message(',
'        p_message => ''ERROR: Map Drawing Control Item [%s] is not associated with a Map region.'',',
'        p0      => p_item.name,',
'        p_level   => apex_debug.c_log_level_error',
'      );',
'      l_error := l_error || ''Configuration ERROR: MapDrawing Control Item ['' || p_item.name || ''] is not associated with a Map region.'';',
'      ',
'  end;',
'  htp.p(''<div id="'' || p_item.name || ''" name="'' || p_item.name || ''"></div>'');',
'  htp.prn(''<script>var l_drawingClob_'' || l_region_id || '' = '');',
'    l_offset := 1;',
'    loop',
'      exit when l_offset >=nvl(dbms_lob.getlength(l_geojson), 0);',
'      htp.prn(dbms_lob.substr(l_geojson, l_buffersize, l_offset));',
'      l_offset := l_offset + l_buffersize;',
'    end loop;  ',
'  htp.prn('';</script>'');',
'',
'',
'--htp.p(''<pre>'' || l_geojson  || ''</pre>'');',
'  -- Call the javascript',
'  apex_javascript.add_onload_code(p_code => ''apex.jQuery(apex.gPageContext$).on("apexreadyend", function(){',
'    mapbits_draw("'' || p_item.name || ''", "'' || apex_plugin.get_ajax_identifier || ''", "'' || l_region_id || ''", "'' || l_geometry_modes || ''", l_drawingClob_'' || l_region_id  || '', '' ||  l_readonly || '', "'' ||  l_show_coords || ''", '' || l_pointZoomLev'
||'el || '',"'' ||  l_error || ''");',
'    });'', p_key => ''MIL.ARMY.USACE.MAPBITS.DRAW'');',
'end;',
'',
'procedure map_drawing_control_validate (',
'    p_item   in            apex_plugin.t_item,',
'    p_plugin in            apex_plugin.t_plugin,',
'    p_param  in            apex_plugin.t_item_validation_param,',
'    p_result in out nocopy apex_plugin.t_item_validation_result ) is',
'    l_geom_collection_name p_item.attribute_02%type;',
'    l_geom sdo_geometry;',
'    rt varchar2(4000);',
'begin',
'  l_geom_collection_name := p_item.attribute_02;',
'  select sdo_util.from_geojson(clob001) into l_geom from apex_collections where collection_name = l_geom_collection_name;',
'  rt := sdo_geom.validate_geometry_with_context(l_geom, 0.001, ''FALSE'', ''TRUE'');',
'  if not rt = ''TRUE'' then',
'    p_result.message := rt;',
'  end if;',
'end;'))
,p_api_version=>2
,p_render_function=>'map_drawing_controls_render'
,p_ajax_function=>'map_drawing_controls_render_ajax'
,p_validation_function=>'map_drawing_control_validate'
,p_substitute_attributes=>true
,p_subscribe_plugin_settings=>true
,p_help_text=>wwv_flow_string.join(wwv_flow_t_varchar2(
'<p>The Mapbits Drawing Control Page Item adds point, line, and/or polygon drawing tools to the Application Express native Map Region. Geometry data in geojson format can be loaded into and saved from the Map Region using an APEX Collection. The inten'
||'ded usage pattern is to create the apex collection in a Pre-Rendering process and add the value of an existing geometry (if one exists) to that clob column of the collection in geojson format. Each time the geometry is edited in the Map, it is writte'
||'n back to the collection. A plsql process should be written to run on page submission to read from the collection and convert the geometry from a geojson clob to sdo_geometry, writing the geometry to the record begin processed by the page submission.'
||'</p>',
'',
'<p>Mapbits Drawing Control is implemented using the mapbox-gl-draw library. For more information, review the map-gl-draw Github site (<a href="https://github.com/mapbox/mapbox-gl-draw">https://github.com/mapbox/mapbox-gl-draw</a>).<p>',
'',
'<p>1/31/2022 - Replaced zoom and setcenter with easeTo to fix initial render.</p>'))
,p_version_identifier=>'4.2.20220207'
,p_about_url=>'https://github.com/darklordgrep/Mapbits'
,p_plugin_comment=>wwv_flow_string.join(wwv_flow_t_varchar2(
'Module   : Mapbits 4 - Draw',
'Location : $Id$',
'Date     : $Date$',
'Revision : $Revision$',
'Requires : Application Express >= 21.1',
'',
''))
,p_files_version=>26
);
