begin
wwv_flow_api.create_install_script(
 p_id=>wwv_flow_api.id(11470435768163567)
,p_install_id=>wwv_flow_api.id(11058226515905914)
,p_name=>'Create Waterways'
,p_sequence=>40
,p_script_type=>'INSTALL'
,p_script_clob=>wwv_flow_string.join(wwv_flow_t_varchar2(
'--------------------------------------------------------',
'--  File created - Thursday-February-03-2022   ',
'--------------------------------------------------------',
'',
'create sequence MB4_WATERWAYS_SEQ NOCACHE START WITH 1000000',
'/',
'--------------------------------------------------------',
'--  DDL for Table WATERWAYS_TEST100',
'--------------------------------------------------------',
'',
'  CREATE TABLE "MB4_WATERWAYS" ',
'   (	"ID" NUMBER PRIMARY KEY, ',
'	"AMILE" NUMBER, ',
'	"ANODE" NUMBER, ',
'	"BMILE" NUMBER, ',
'	"BNODE" NUMBER, ',
'	"CHART_ID" NUMBER, ',
'	"CTRL_DEPTH" NUMBER, ',
'	"DATE_MOD" VARCHAR2(8), ',
'	"DIR" NUMBER, ',
'	"FIPS" VARCHAR2(2), ',
'	"FIPS2" VARCHAR2(2), ',
'	"FUNC_CLASS" VARCHAR2(2), ',
'	"GEO_CLASS" VARCHAR2(2), ',
'	"HEADING" VARCHAR2(2), ',
'	"RIVERNAME" VARCHAR2(800), ',
'	"SHAPE_SRC" VARCHAR2(2), ',
'	"STATE" VARCHAR2(2), ',
'	"WATERWAY" NUMBER, ',
'	"WTWY_TYPE" VARCHAR2(4000),  ',
'	"SHAPE" "SDO_GEOMETRY" ',
'   ) ;',
'   ',
'   --------------------------------------------------------',
'--  DDL for Index UDIS_SDO_I',
'--------------------------------------------------------',
'  begin',
'  APEX_SPATIAL.INSERT_GEOM_METADATA (p_table_name => ''MB4_WATERWAYS'',p_column_name => ''SHAPE'',',
'  p_diminfo=> MDSYS.SDO_DIM_ARRAY(MDSYS.SDO_DIM_ELEMENT(''X'', -180, 180, 1E-8), MDSYS.SDO_DIM_ELEMENT(''Y'', -90, 90, 1E-8)),',
'  p_srid => 8265);',
'  end;',
'    /',
'  CREATE INDEX "WWY_SDO_I" ON "MB4_WATERWAYS" ("SHAPE") ',
'   INDEXTYPE IS "MDSYS"."SPATIAL_INDEX"  PARAMETERS (''SDO_COMMIT_INTERVAL = 1000, LAYER_GTYPE = LINE'');',
'',
'   --------------------------------------------------------',
'--  DDL for Trigger USACE_DISTRICTS_BIR',
'--------------------------------------------------------',
'',
'  CREATE OR REPLACE EDITIONABLE TRIGGER "MB4_WATERWAYS_BIR" ',
' BEFORE INSERT ON MB4_WATERWAYS for each row',
' begin',
' IF :new.id IS NULL or :new.id = 0 THEN',
'     SELECT MB4_WATERWAYS_SEQ.nextval into :new.id from dual;',
' END IF;',
' end;',
'/',
'ALTER TRIGGER "MB4_WATERWAYS_BIR" ENABLE;',
'',
'',
''))
);
end;
